export function fetchCarachters() {
  return {
    type: 'FETCH_CARACHTERS_START',
  };
}

export function filterCarachtersStart(searchText) {
    return {
      type: 'FILTER_CARACHTERS_START',
      payload: searchText,
    };
  }

  export function fetchCarachtersSuccess(carachters) {
    return {
      type: 'FETCH_CARACHTERS_SUCCESS',
      payload: carachters,
    };
  }

  export function fetchCarachtersError(carachters) {
    return {
      type: 'FETCH_CARACHTERS_ERROR',
      payload: carachters,
    };
  }
